
/*Table structure for table `privilegios` */

DROP TABLE IF EXISTS `privilegios`;

CREATE TABLE `privilegios` (
  `fecha` date DEFAULT NULL COMMENT 'Fecha en que se asigna el privilegio',
  `id_organismos` varchar(2) COLLATE utf8_spanish_ci DEFAULT NULL,
  `id_usuarios` varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  `estatus` char(1) COLLATE utf8_spanish_ci DEFAULT NULL COMMENT 'estaus A(activo) R(revocado)',
  `fecha_actualizacion` date DEFAULT NULL COMMENT 'Fecha en que se realiza algun cambiio',
  `id_roles` int(2) DEFAULT NULL,
  `id_licencias` int(2) DEFAULT NULL,
  `fecha_asig_lic` datetime DEFAULT NULL,
  `fecha_canc_lic` datetime DEFAULT NULL,
  `id_privilegios` int(11) NOT NULL AUTO_INCREMENT,
  `tipo_acceso` char(1) COLLATE utf8_spanish_ci DEFAULT NULL COMMENT 'null accede a PN, 4 accede a x00 y 610, A accede a todo',
  PRIMARY KEY (`id_privilegios`)
) ENGINE=InnoDB AUTO_INCREMENT=231 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

